// BackgroundImages
import React, { Component } from 'react'

import { Draggable } from 'react-beautiful-dnd'
export default class BackgroundImages extends Component {
  render () {
    const imagesArray = [
      { id:'1', url: 'https://www.fillmurray.com/640/360' },
      { id:'2', url: 'https://dummyimage.com/640x360/fff/aaa' },
      { id:'3', url: 'https://loremflickr.com/640/360' },
      { id:'4', url: 'https://placekitten.com/408/287' },
      { id:'5', url: 'https://www.fillmurray.com/640/360' },
      { id:'6', url: 'https://www.placecage.com/640/360' },
      { id:'7', url: 'http://placeimg.com/640/360/any' },
      { id:'8', url: 'https://placebear.com/640/360' },
      { id:'9', url: 'https://imgplaceholder.com/640x360' },
      { id:'10', url: 'https://placezombie.com/640x360' },
      { id:'11', url: 'https://www.fillmurray.com/640/360' },
      { id:'12', url: 'https://dummyimage.com/640x360/fff/aaa' },
      { id:'13', url: 'https://loremflickr.com/640/360' },
      { id:'14', url: 'https://placekitten.com/408/287' },
      { id:'15', url: 'https://www.fillmurray.com/640/360' },
      { id:'16', url: 'https://www.placecage.com/640/360' },
      { id:'17', url: 'http://placeimg.com/640/360/any' }
    ]
    return (
      <div className='slideContent'>
        {
          imagesArray.map((image,index)=>{
             console.log('images >>', image.id)
            return (
              <Draggable draggableId='draggable' index={index}>
                {(provided, snapshot) => (
                  <div
                    ref={provided.innerRef}
                    {...provided.draggableProps}
                    {...provided.dragHandleProps}
                    className='draggableThumb'
                  >

                    <img src={image.url} />
                   </div>
                )}
              </Draggable>
            )
          })
        }

      </div>
    )
  }
}
